// server.js
const express = require('express');
const bodyParser = require('body-parser');
const sudokuSolver = require('./solver'); // Import your Sudoku solver module

const app = express();
const port = 3002;

app.use(bodyParser.json());

// Handling the Sudoku board POST request
app.post('/api/sudoku', (req, res) => {
  const sudokuBoard = req.body.board;

  // Process the Sudoku board data as needed (e.g., solve the Sudoku puzzle)
  console.log('Received Sudoku Board:', sudokuBoard);

  // Assume sudokuSolver.solveSudoku is your solving function
  const solvedGrid = sudokuSolver.solver(sudokuBoard);
  console.log('Solved Sudoku Board:', solvedGrid);

  // Send a response back to the client with the solved grid
  res.json({ solvedGrid });
});

// Start the server
app.listen(port, () => {
  console.log(`Server is running on port ${port}`);
});
